import React from 'react';
// dependencies
import { Route, Switch } from "react-router-dom";
// import css files
import './css/style.css';
// components 
import Search from './components/Search';
import EventList from './components/EventList';
function App() {
  return (
    <>
      <Search />
      <EventList />
      <Switch>
        <Route exact path="/">
          <App />
        </Route>
        <Route path="/events/:eventId">
          <EventDetail />
        </Route>
      </Switch>
    </>
  );
}

export default App;
